	//6-bit 64 element sin wave
const uint8_t wave[64] = {
  32,35,38,41,44,47,49,52,54,56,58,
  59,61,62,62,63,63,63,62,62,61,59,
  58,56,54,52,49,47,44,41,38,35,
  32,29,26,23,20,17,15,12,10,8,
  6,5,3,2,2,1,1,1,2,2,3,
  5,6,8,10,12,15,17,20,23,26,29};

//global variables
const uint8_t *wavpt;		//sound array
	uint32_t idx = 0; //idx is index to the wave array
	uint32_t N;			//size of wave table
	uint8_t EffectFlag;


void Sound_Init(void){
	DAC_Init();
	Timer0_Init(0xFFFFFF, 2);
    // initialize a Timer0A, and the DAC
};
void Timer0A_Handler(void){
  TIMER0_ICR_R = 0x01;   // acknowledge TIMER0A timeout
  // output one value to DAC if a sound is active
	DAC_Out(wavpt[idx]);
	if (EffectFlag == 0) {
		idx = (idx+1)%N;
	}
	else {
		idx++;
		if (idx >= N) {
			EffectFlag = 0;
			wavpt=wave;
			N=64;
			TIMER0_TAILR_R=0xFFFFFF;
		}
	}

}


//******* Sound_Start ************
// This function does not output to the DAC.
// Rather, it sets a pointer and counter, and then enables the timer interrupt.
// It starts the sound, and the timer ISR does the output
// feel free to change the parameters
// Input: pt is a pointer to an array of DAC outputs
//        count is the length of the array
// Output: none
// special cases: as you wish to implement
void Sound_Start(const uint8_t *pt, uint32_t count, uint32_t period, uint8_t NorE){
// write this
	wavpt=pt;
	N=count;
	EffectFlag=NorE;
	TIMER0_TAILR_R = period-1;    // 4) reload value
	TIMER0_CTL_R = 0x00000001;    // 10) enable TIMER0A
};
void Sound_Stop(void) {
	TIMER0_CTL_R = 0;
	DAC_Out(0);
};
void Sound_Note(uint32_t period) {
	Sound_Start(&wave[0],64, period, 0);
}

void Sound_Isabella_Voice(void){
	Sound_Start(isabella_voice, 33569, 7272, 1);
};

void Sound_TomNook_Voice(void){
	Sound_Start(tomnook_voice,63872,7272,1);
};

